import React from 'react';
import UHeader from './UHeader.js'
import Footer from './Footer.js'

export default class Main extends React.Component {
  getSelections () {
    return [
      <Nav.Link as={Link} to="/"><UButton variant="u-white" content="Home" /></Nav.Link>,
      <Nav.Link as={Link} to="/create_account"><UButton variant="u-action" content="Sign Up" /></Nav.Link>
    ]
  }
  render() {
    return (
      <div style={{backgroundColor: '#f8f9fa'}}>
        <UHeader />
        {/* Content is dynamically added based on the url */}
        <Footer />
      </div>
    )
  }
}
